import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <>
      <div class="expense-item"> March 28th, 2021. </div>
      <div>
        <h2>Car Insurance</h2>
        <div>242</div>
      </div>
    </>
  );
}

export default ExpenseItem;
